    comparisons = 1
    swaps = 0
    n = len(numbers)
    for i in range(n - 1):
        for j in range(n - i - 1):
            comparisons += 1
            if numbers[j] > numbers[j + 1]:
                (numbers[j], numbers[j + 1]) = (numbers[j + 1], numbers[j])
                swaps += 1
    return (tuple(numbers), comparisons, swaps)

